import React from 'react';
import './nav.css';

function Nav() {

    const navBarStyle = () => {
        return {
        backgroundColor: 'white',
        color: 'black',
        };
    };

  return (
    <div className="cover">
        <div className="navbar" style={navBarStyle()}>
            <ul className='navContainer'>
                <li>Home</li>
                <li>About Me</li>
                <li>Portfolio</li>
                <li>Resume</li>
            </ul>
        </div>
    </div>
  );
}

export default Nav;
